import React from 'react';
import styled from 'styled-components';
import ImageSrc from './assets/travel.png'; // 이미지 경로

const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: #000; /* 배경색을 검정으로 설정 */
`;

const Circle = styled.div`
  width: 300px; /* 원의 크기 조절 */
  height: 300px;
  border-radius: 50%;
  background-color: #e7d355; /* 원의 배경색 설정 */
  display: flex;
  justify-content: center;
  align-items: center;
  overflow: hidden;
`;

const Image = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

const Choice = ()=>{
    return (
        <Container>
          <Circle>
            <Image src={ImageSrc} alt="Example" />
          </Circle>
        </Container>
      );
}
